public Collection fields() {
  Collection fields = new HashSet();
  for(int i=0;i<fieldHash.length;i++) {
    DocFieldProcessorPerField field = fieldHash[i];
    while(field != null) {
      fields.add(field.consumer);
      field = field.next;
    }
  }
  assert fields.size() == totalFieldCount;
  return fields;
}

